		[6] = "mobile suit gundam movie ii",
		[7] = "mobile suit gundam - the movie trilogy part ii",
		[8] = "機動戦士ガンダム ＩＩ　哀・戦士編",
		["title"] = "Kidou Senshi Gundam II: Ai Senshi Hen",
	},
}
local search = ...
if(not search) then return end
search = search:lower():gsub("'", '`')

local out = {}
for aid, data in next, db do
	for k, v in ipairs(data) do
		if(v:find(search, 1, true)) then
			out[aid] = {data.title; data['title-en'];}
			break;
		end
	end
end


for aid, data in next, out do
	io.write(string.format('%s|%s\031', aid, data[1] or 'no... title?'))
end
